import React, { useState, useEffect } from 'react';
import './Dhikr.css';

const translations = {
  tr: {
    count: "Sayı",
    setTarget: "Zikir Hedefi Koy",
    targetReached: "Hedefe Ulaşıldı!"
  },
  ar: {
    count: "عدد",
    setTarget: "تعيين الهدف",
    targetReached: "وصلت إلى الهدف!"
  },
  fr: {
    count: "Nombre",
    setTarget: "Définir l'objectif",
    targetReached: "Objectif atteint!"
  },
  en: {
    count: "Count",
    setTarget: "Set Dhikr Target",
    targetReached: "Target Reached!"
  },
  ru: {
    count: "Число",
    setTarget: "Установить цель",
    targetReached: "Цель достигнута!"
  },
  zh: {
    count: "计数",
    setTarget: "设定目标",
    targetReached: "目标达成!"
  },
  de: {
    count: "Anzahl",
    setTarget: "Ziel setzen",
    targetReached: "Ziel erreicht!"
  },
  kk: {
    count: "Саны",
    setTarget: "Мақсат қою",
    targetReached: "Мақсатқа жетті!"
  },
  az: {
    count: "Say",
    setTarget: "Hədəfi təyin et",
    targetReached: "Hədəfə çatdı!"
  }
};

const Dhikr = () => {
  const [language, setLanguage] = useState('en');
  const [count, setCount] = useState(0);
  const [target, setTarget] = useState(null);
  const [percentage, setPercentage] = useState(0);
  const [targetReached, setTargetReached] = useState(false);

  useEffect(() => {
    const selectedLanguage = localStorage.getItem('selectedLanguage') || 'en';
    setLanguage(selectedLanguage);
  }, []);

  const handleDhikrClick = () => {
    if (target === null || count < target) {
      const newCount = count + 1;
      setCount(newCount);
      if (navigator.vibrate) {
        navigator.vibrate(200); // Cihazı titret
      }
      if (target !== null) {
        const newPercentage = (newCount / target) * 100;
        setPercentage(newPercentage);
        if (newCount >= target) {
          setTargetReached(true);
          setTimeout(() => setTargetReached(false), 2000); // 2 saniye sonra patlama efektini gizle
        }
      }
    }
  };

  const handleSetTarget = () => {
    const userTarget = parseInt(prompt("Enter your Dhikr target:", ""), 10);
    if (!isNaN(userTarget) && userTarget > 0) {
      setTarget(userTarget);
      setCount(0);
      setPercentage(0);
      setTargetReached(false);
    }
  };

  const styles = {
    container: {
      width: '100%',
      height: '100vh',
      display: 'flex',
      flexDirection: 'column',
      justifyContent: 'center',
      alignItems: 'center',
      backgroundColor: '#fff', // Beyaz arka plan
      fontFamily: 'Arial, sans-serif',
    },
    count: {
      fontSize: 48,
      fontWeight: 'bold',
      margin: 20,
      color: 'black',
    },
    button: {
      width: 150,
      height: 50,
      background: '#31934D',
      borderRadius: 12,
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      border: 'none',
      cursor: 'pointer',
      color: 'white',
      fontSize: 18,
      transition: 'background 0.3s, box-shadow 0.3s',
      boxShadow: '0 8px 12px rgba(0, 0, 0, 0.2)',
      margin: 10,
    },
    buttonText: {
      fontSize: 18,
    },
    targetContainer: {
      margin: 20,
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
    },
    progressCircle: {
      width: 200,
      height: 200,
      borderRadius: '50%',
      border: '10px solid #31934D', // Kenarları yeşil
      position: 'relative',
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      background: 'white',
    },
    filledCircle: {
      content: '""',
      position: 'absolute',
      width: '100%',
      height: '100%',
      borderRadius: '50%',
      background: 'conic-gradient(#31934D 0% ' + percentage + '%, #ccc ' + percentage + '% 100%)',
      transition: 'background 0.3s',
    },
    circleText: {
      position: 'absolute',
      fontSize: 24,
      fontWeight: 'bold',
      color: 'black',
    },
    explosion: {
      width: 200,
      height: 200,
      borderRadius: '50%',
      background: 'url(/path/to/explosion.gif) no-repeat center center',
      backgroundSize: 'cover',
      position: 'absolute',
    }
  };

  return (
    <div style={styles.container}>
      <button style={styles.button} onClick={handleSetTarget}>
        <span style={styles.buttonText}>
          {translations[language]?.setTarget || "Set Dhikr Target"}
        </span>
      </button>
      <div style={styles.count}>
        {translations[language]?.count || "Count"}: {count}
      </div>
      {target !== null && (
        <div style={styles.targetContainer}>
          <div style={styles.progressCircle}>
            <div style={styles.filledCircle}></div>
            <span style={styles.circleText}>
              {count}/{target}
            </span>
            {targetReached && <div style={styles.explosion}></div>}
          </div>
        </div>
      )}
      <button style={styles.button} onClick={handleDhikrClick}>
        <span style={styles.buttonText}>Dhikr</span>
      </button>
    </div>
  );
};

export default Dhikr;
